import React from 'react';
import './App.scss';

import Card from "./components/card/SymbolCard"

function App() {
  return (
    <div className="App">
      <div className="card-container">
        <Card trending="green"></Card>
        <Card trending="green"></Card>
        <Card trending="red"></Card>
        <Card trending="red"></Card>
        <Card trending="green"></Card>
        <Card trending="green"></Card>
      </div>
    </div>
  );
}

export default App;
